sourcesContent:
$(document).ready(function () {
    $("body").on("click", '.show_pagination .pagination a', function(e){
        e.preventDefault();
        $.getScript(this.href);
        console.log("succses response")
        return false;
    });
    console.log("unsuccses response")
});
